Mandrill (2009)

Antonio's parents were murdered when he was a child. As an adult, he is transformed into a relentless bounty hunter, code-named &quot;Mandrill,&quot; with the sole aim of finding the murderer and avenging his parents. Mandrill's only weakness has always been women, so he asks his uncle, a &quot;Don Juan&quot; expert, to instruct him in the arts of seduction. When Mandrill is hired to capture a powerful Mafioso casino owner, he soon discovers that this is the man who he has searched for all these years. But upon meeting Dominique, the beautiful daughter of the casino owner, begins an impossible romance, which can be the only obstacle to his revenge.  

